import logo from './logo.svg';
import './App.css';

import Menu from './Menu'
import Equipos from './Equipos'

function App() {
  return (
    <div className="container">
    <Menu />

    <Equipos nombre="Real Madrid"/>
    <Equipos nombre="F.C. Barcelona"/>
    <Equipos />
    </div>
  );
}

export default App;
